import React from "react";
import "../Products.css";
import "../App.css";
import { Link } from "react-router-dom";

const datas = [
  {
    id: "24",
    img: "/imgservices/services-5.jpg",
    alt: "1",
    title: "ตู้ควบคุม",
    decrition: "",
  },
  {
    id: "25",
    img: "/imgservices/services-6.jpg",
    alt: "1",
    title: "อุปกรณ์ตรวจจับควันไฟ",
    decrition: "",
  },
  {
    id: "26",
    img: "/imgservices/services-7.jpg",
    alt: "1",
    title: "อุปกรณ์ตรวจจับความร้อน",
    decrition: "",
  },
  {
    id: "27",
    img: "/imgservices/services-8.jpg",
    alt: "1",
    title: "อุปกรณ์สัญญาณแจ้งเตือน",
    decrition: "",
  },
  {
    id: "28",
    img: "/imgservices/services-9.jpg",
    alt: "1",
    title: "อุปกรณ์แจ้งเหตุด้วยมือ",
    decrition: "",
  },
  {
    id: "29",
    img: "/imgservices/services-10.jpg",
    alt: "1",
    title: "อุปกรณ์เสริม",
    decrition: "",
  },
];

export default function ContactUs() {
  return (
    <div className="area">
      <div className="containers">
        <div className="item-containers">
          {datas.map(function (data, i) {
            return (
              <div>
                <div className="img">
                  {/* <p className="datanumber">{data.id}</p> */}
                  <img src={data.img} alt="1" />
                </div>
                <Link to="/Products">
                  <button className="data-one">
                    {data.title} <style></style>
                  </button>
                </Link>

                <p className="data-two">{data.decrition}</p>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}
